    public static int uniquePathsWithObstacles(int[][] obstacleGrid) {
    	if(obstacleGrid[0][0] == 1) return 0;
    	
    	int[][] map = new int[obstacleGrid.length + 1][obstacleGrid[0].length + 1];
    	for(int i = 0; i < map.length; i++){
    		for(int j = 0; j < map[0].length; j++){
    			map[i][j] = -1;
    		}
    	}	
    	
    	return unique(obstacleGrid, 1, 1, map);
    }
    
    public static int unique(int[][] obstacleGrid, int x, int y, int[][] map) {
    	
    	
    	if(x == obstacleGrid.length && y == obstacleGrid[0].length){
    		if(obstacleGrid[x-1][y-1] == 0){
    			map[x][y] = 1;
        		return 1;
    		}else{
    			map[x][y] = 0;
    			return 0;
    		}		
    	}
    	
    	if(x > obstacleGrid.length || y > obstacleGrid[0].length){
    		map[x][y] = 0;
    		return 0;
    	}
    	
    	if(x < obstacleGrid.length && map[x+1][y] == -1){
    		if(obstacleGrid[x][y-1] == 0)
    			map[x+1][y] = unique(obstacleGrid, x+1, y, map);
    		else
    			map[x+1][y] = 0;
    	}
    	
    	if(y < obstacleGrid[0].length && map[x][y+1] == -1 ){
    		if(obstacleGrid[x-1][y] == 0)
    			map[x][y+1] = unique(obstacleGrid, x, y+1, map);
    		else
    			map[x][y+1] = 0;
    	}

    	if(x < obstacleGrid.length && y < obstacleGrid[0].length)
    		return map[x+1][y] + map[x][y+1];
    	if(x < obstacleGrid.length){
    		return map[x+1][y];
    	}
    	if(y < obstacleGrid[0].length){
    		return map[x][y+1];
    	}
    	return 0;
    }

